    // },
    // {
    //     path : '/reset',
    //     element : <Reset></Reset>
    // },
    // {
    //     path : '*',
    //     element : <PageNotFound></PageNotFound>
    // },
])

export default function App() {
  return (
    <main>
        <RouterProvider router={router}></RouterProvider>
    </main>
  )
}
